import * as action from "./actions";

const initialState = {
  halko: ""
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case "INPUT_CHANGE":
      return {
        state
      };

    default:
      return state;
  }
};

export default reducer;
